  "ジン", "トリトン", "ダゴン",
  "ワカン・タンカ∞", "タンガロア∞", "イスラフィール", "キリト", "ビッグフット", "ハスター", "ベオウルフ", "クアンタム", "マサシ", "コクリュウギケン", "ウィリー・ワイルドキャット", "キョウマ", "カレン&MS-C1",
