var OBTAIN_FLAG = {
  TRANSIENT: 1,
  ALLY: 1 << 1,
  FORTUNE: 1 << 2,
  EVENT: 1 << 2,
  MAIN: 1 << 3,
  FREE: 1 << 4,
  SHOP: 1 << 5
}
var MAX_LEVEL_SEED = 20;

function Card(index, id, name, variant, guilds, schools, teams, obtain, e, x){
  var n = 0;
  var skills = e.map(function(s){
    return splitSkills(s);
  });
  skills.splice(3, 0, skills[0]);
  this.index = index;
  this.id = id;
  this.name = name;
  this.variant = variant;
  this.rarity = x[0];
  this.maxLv = x[0] ? 45 + x[0] * 5 : 1;
  this.attribute = x[1];
  this.weapon = [x[2], x[3]];
  this.baseAtk = x[4] || 0;
  this.growth = new Fraction(x[5], 98);
  this.csBoost = x[6] || 0;
  this.guilds = guilds;
  this.schools = schools;
  this.teams = teams;
  this.effects = [
    generateEffectData(skills[0], 0),
    generateEffectData(skills[1], 0),
    generateEffectData(skills[2], 1)
  ];
  this.tag = skills.map(function(s, i){
    n += s.size;
    return generateTagData(s, i);
  });
  this.limited = !(!variant && LIMITED_CARD.indexOf(t(name, 0)) === -1);
  if(obtain){
    this.obtain = obtain;
  }else if(this.rarity > 2){
    this.obtain = OBTAIN_FLAG.TRANSIENT;
  }else{
    this.obtain = OBTAIN_FLAG.ALLY;
  }
  this.notag = !n;
}
Card.prototype = {
  toString: function(){
    var name = t(this.name) + t("/ ");
    if(!this.name) return "－";
    if(name[0] === "(") name = t(this.name, 0) + name;
    if(!this.growth.n) name = "× " + name;
    if(this.notag) name = "※ " + name;
    if(this.rarity < 3) return name + "(" + ATTRIBUTE[this.attribute] + ")";
    if(this.variant) return name + "(" + t(this.variant).slice(0, -2) + ")";
    return name + "☆" + this.rarity;
  },
  getValue: function(lv, enemy){
    if(enemy) return this.growth.add(this.baseAtk, 98).mul((lv || 1) - 1, 1).add(this.baseAtk, 1).round();
    return this.growth.mul((lv || 1) - 1, 1).add(this.baseAtk, 1).round();
  },
  canEquip: function(x, external){
    var guilds = external ? GUILD.exists : this.guilds;
    if(!this.index || !x.index) return true;
    if(x.chara.length && x.chara.indexOf(this.index) !== -1) return true;
    if(x.rarity & (1 << this.rarity)) return true;
    if(x.weapon & (1 << this.weapon[0])) return true;
    if(x.attribute & (1 << this.attribute)) return true;
    if(x.guilds & guilds) return true;
    if(x.schools & this.schools) return true;
    return false;
  }
};
Card.createList = function(a){
  var name = "";
  var guilds = 0;
  var schools = 0;
  var teams = 0;
  var obtain = 0;
  var e = ["", "", "", "", ""];
  var ids = [];
  var table = new Map();
  var same = [];
  var result = a.map(function(v, i){
    var id = v.shift();
    var variant = "";
    if(ids.indexOf(id) !== -1) throw new Error("カードIDが重複しています（" + id + "）");
    ids.push(id);
    if(v[0] && v[0][0] !== "@"){
      name = v[0];
      guilds = splitGuildNames(v[1]);
      schools = splitSchoolNames(v[2]);
      teams = splitTeamNames(v[3]);
      obtain = v[4];
      same = [];
      if(v[6] > 2) table.set(t(name, 0), same);
      e = v[5];
    }else{
      variant = v[0].slice(1);
      if(v[1]) guilds = splitGuildNames(v[1]);
      if(v[2]) schools = splitSchoolNames(v[2]);
      if(v[3]) teams = splitTeamNames(v[3]);
      if(v[4] >= 0) obtain = v[4];
      e = v[5].map(function(s, j){
        if(s === "*") return e[j];
        return s;
      });
    }
    same.push(i);
    return new Card(i, id, name, variant, guilds, schools, teams, obtain, e, v.slice(6));
  });
  result.table = table;
  return result;
};
Card.csv = function(list, x){
  return list.map(function(v){
    if(!v.name){
      return t("#,レア度,名前,バージョン,限定,属性,武器タイプ,CSタイプ,CS倍率,基礎ATK,成長率*98,最大Lv,ATK(最大Lv),ATK(最大Lv+" + MAX_LEVEL_SEED + "),ダメージ補正(自身),ダメージ補正(味方),ダメージ補正(敵),効果(自身),効果(味方),効果(敵),特攻,特防,状態無効,ギルド,学園,その他,入手/#,Rarity,Name,Variant,Limited,Attribute,WeaponType,CSType,CSRate,BaseATK,GrowthRate*98,MaxLv,ATK(MaxLv),ATK(MaxLv+" + MAX_LEVEL_SEED + "),DamageModifiers(Self),DamageModifiers(Ally),DamageModifiers(Enemy),Effects(Self),Effects(Ally),Effects(Enemy),AttackBonus,DefenseBonus,NullifyStatus,Guilds,Schools,Others,Obtain", x);
    }else{
      var r = [
        v.index,
        v.rarity,
        t(v.name, x),
        t(v.variant, x),
        v.limited ? "○" : "",
        t(ATTRIBUTE[v.attribute].name, x),
        t(WEAPON[v.weapon[0]].name, x),
        t(WEAPON[v.weapon[1]].name, x),
        v.csBoost ? ("(+" + v.csBoost + ")").replace("+-", "-") : "",
        v.baseAtk,
        v.growth.muln(98),
        v.maxLv,
        v.getValue(v.maxLv),
        v.getValue(v.maxLv + MAX_LEVEL_SEED)
      ];
      v.effects.forEach(function(z){
        r.push(z.map(function(n){
          return (n > EFFECT_MAX ? "{CS}" : "") + t(EFFECT[n % EFFECT_MAX].name, x)
        }).join("/"));
      });
      v.tag.forEach(function(z, i){
        var skip = [];
        r.push(z.map(function(a){
          var tag = TAG[a[0] % TAG_MAX];
          if(!tag.reading || skip.indexOf(tag.index) !== -1) return 0;
          switch(tag.type){
            case TAG_TYPE.ALL_BUFFS:
            case TAG_TYPE.ALL_DEBUFFS:
            case TAG_TYPE.SKILL:
              if(tag.subset.length) skip = skip.concat(tag.subset);
              break;
            case TAG_TYPE.CATEGORY:
              return 0;
          }
          return timing2str(a[1], x) + t(tag.name, x);
        }).filter(function(n){return n}).join("/"));
      });
      r.push(
        bit2array(GUILD, v.guilds, x).join("/"),
        bit2array(SCHOOL, v.schools, x).join("/"),
        bit2array(TEAM, v.teams, x).join("/"),
        bit2array(OBTAIN, v.obtain, x).join("/")
      );
      return r.join(",");
    }
  }).join("\n");
};

